import React from 'react'
import {RadioOtherComp} from "../Components/RadioComp";


class FormMDM extends React.Component {
    render() {
        return (
            <div>
                <main>
                    <h1>III. Medical Decision Making</h1>
                    <RadioOtherComp
                        label = "Clinical Global Impression:"
                    />

                </main>
            </div>
        );
    }
}



export default FormMDM;
